INSERT INTO `pages` VALUES (1,'Lịch sử hình thành','lich-su-hinh-thanh','\n<p><b><br></b></p>\r\n<span style=\"font-size: 18px;\">\r\n</span><p class=\"MsoNormal\" style=\"text-align: center; text-indent: 0.5in;\"><span style=\'font-size:14.0pt;line-height:115%;font-family:\"Times New Roman\",\"serif\";\r\ncolor:black;mso-themecolor:text1\'><b><span style=\"font-size: 36px;\">Nha Khoa Beauty gi</span></b></span><font color=\"#000000\" face=\"Times New Roman, serif\"><span style=\"font-size: 36px;\"><b>ới thiệu</b></span></font></p>\r\n<p></p>\r\n<p></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:.5in\"><span style=\'font-size:14.0pt;line-height:115%;font-family:\"Times New Roman\",\"serif\";\r\ncolor:black;mso-themecolor:text1\'></span></p>\r\n<p> </p>\r\n<p></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 48px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; text-align: start; text-indent: 0px;\">Trải qua hơn 10 năm hoạt động và phát triển phòng khám Nha Khoa Thẩm Mỹ nay là Công ty cổ phần Beauty Dental </span><font color=\"#1d2129\" face=\"Helvetica, Arial, sans-serif\">được thành lập vào năm 2017</font><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; text-align: start; text-indent: 0px;\"> đã có những đóng góp lớn trong việc chăm sóc sức khỏe răng miệng cho cộng đồng. </span><span style=\"text-indent: 0.5in; color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">Beauty Dental</span><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; text-align: start; text-indent: 0px;\"> lu</span><font color=\"#1d2129\" face=\"Helvetica, Arial, sans-serif\">ôn lỗ lực hết mình hoàn thiện </font><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; text-align: start; text-indent: 0px;\">chất lượng dịch vụ nghi</span><font color=\"#1d2129\" face=\"Helvetica, Arial, sans-serif\">ên cứu và cập nhật công nghệ mới</font><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; text-align: start; text-indent: 0px;\"> để luôn là địa chỉ tin cậy, uy tín h</span><font color=\"#1d2129\" face=\"Helvetica, Arial, sans-serif\">àng đầu Việt Nam trong lĩnh vực </font><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; text-align: start; text-indent: 0px;\">phục hình răng thẩm mỹ, nắn chỉnh răng và cấy </span><span class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); text-align: start; text-indent: 0px;\">ghép implant nha khoa. (Ảnh 01)</span><span style=\"text-indent: 0.5in;\">    </span><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; text-align: start; text-indent: 0px;\">  </span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 48px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; text-align: start; text-indent: 0px;\">Nha khoa Beauty - N</span><font color=\"#1d2129\" face=\"Helvetica, Arial, sans-serif\">ơi hội tụ của các chuyên gia</font><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; text-align: start; text-indent: 0px;\">       </span></p>\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:.5in\"><span class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); text-align: start; text-indent: 0px;\">Nha Khoa Beauty được mệnh danh là nơi hội tụ của những chuyên gia tu nghiệp chuyên sâu nhiều năm trong cũng như ngoài nước, có chuyên môn cao và nhiều năm kinh nghiệm trong ngành nha khoa và luôn giữ vững y đức và giỏi chuyên môn. Tại nha khoa beauty khách hàng còn được thăm khám trực tiếp bởi các chuyên gia quốc tế đến từ Mỹ, Úc, Hàn Quốc, Singapor.</span></p>\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:.5in\"><span class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); text-align: start; text-indent: 0px;\"><br></span></p>\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:.5in\"><span class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); text-align: start; text-indent: 0px;\"> </span></p>\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:.5in\"><span class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); text-align: start; text-indent: 0px;\">Những năm gần đây nhờ cuộc cách mạng công nghiệp lần thứ tư ngành nha khoa nước nhà đã đạt được những bước tiến lớn, rút ngắn khoảng cách với nền nha khoa thế giới. <a href=\"https://l.facebook.com/l.php?u=http%3A%2F%2FNhakhoagiatot.com%2F&amp;h=ATNeAmYzcxXweIGKI0SFQ3uozqPzuEZ-W1TnPLnjPT0PhoRuenOxeIffhFkj46rrkd8xn-nBqFHQes9nrMaAXByQZbMjlLOP_ecepxUj5d4j9lyHHZym-35R92hDPKRptaHY4-3Bkhr5srN_zT7pwY8_nsi7YOTwl5abk_Z3&amp;enc=AZNS9mvAzJW-mqnIw4prJ2MnwV1_eE46Puds9TpAY7jz24_-aIUCQgHsw90j9v12J_CzuvdL5wQlLZIWFRZj33WMyxcF3VzTFWA3d7fKQXrJjAsAw7RlwlmiJDIUKcfMmRMrE9MTC3w6Gy9mz4t6a5CbD5BUEtXUF2vOKzIXzzm5-N_8G9xG_0FxRos2onZyBpg&amp;s=1\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(54, 88, 153); cursor: pointer; font-family: inherit;\">Nhakhoagiatot.com</a> luôn cập nhật công nghệ mới nhất và tinh chỉnh những quy trình kỹ thuật để mang tới cho quý khách hàng một dịch vụ nha khoa chất lượng cao với giá cả hợp lý nhất đó cũng là tiêu chí mà <a href=\"https://l.facebook.com/l.php?u=http%3A%2F%2Fnhakhoagiatot.com%2F&amp;h=ATM3muvQYoK9CpkFN-ENjQ4GUgTbwZX45FgbcByO3xIBUZadhXeM3VDB_fUx1VzpEb78QHv8yMdxwxo1n_td5-2eaE0J6oQM6S6P0cmSLEohS6gmH_HuLVSS5dN5V9yPOB9tTf9XjqQK_piFwkUJVZp1RABW5dl6YibF6xm_&amp;enc=AZOvBhTrGzf1OrsToYiPYk4B-i8jZa2HmSJoBStfpVUtk-ARy9tkrDdIqZgpJ_HCczbimq7yJXrxrKQmppaIJFo50FrxuA6ysxeBz5HBoG7ooyJ2wm3fDRPF0CZWTix50cylyEjr_Krj6FMdMfuRpgUmQVvuQ9aXP4